&lt;p&gt;&lt;strong&gt;Plot&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;&lt;em&gt;A new view of ancient Rome as seen through the romance of Cleopatra (Sonora) and Marc Antony (Rocco), and then through that of Cleopatra and Julius Caesar (Edwards). The film glosses over historical fact and focuses instead on the characters' sex lives. It insinuates that actual historical events, such as the death of Caesar, Antony's suicide, and the death of Cleopatra, were the direct result of the jealousies and passions of both men for the Queen of the Nile. The plot is clouded by many sexual encounters between Sonora, as Cleopatra, and various centurions. An exploitation film disguised as historical drama.&lt;/em&gt;&lt;/p&gt;

